import './App.css';
import { useState } from 'react';
import FilePreview from './FilePreview';

function App() {
  const [list, setList] = useState(null);
  setList(document.getElementsByClassName("file-preview__container"))


  return (
    <div className="App">
      <button>
        {!list ? "test" : list}
      </button>
      <FilePreview />
    </div>
  );
}

export default App;
